// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract tokenStaking{
    //Declaraciones iniciales
    string public name = "TokenStake";
    string public symbol = "TKS";
    uint256 public totalSupply = 10**24;
    uint256 public  decimals = 18;

    //Eventos
    event Transfer (address indexed _from, address indexed to, uint256 _value);
    event Approval (address indexed _owner, address indexed _spender, uint256 _amount);

    //Estructuras de Datos
    mapping (address=>uint256) public balanceOf;
    mapping (address=>mapping (address=>uint256)) public allowance;

    constructor(){
        balanceOf[msg.sender] = totalSupply;
    }

    //Funciones
    function transfer(address _to, uint256 _value) public returns (bool success){
        require (balanceOf[msg.sender]>=_value, "Fondos insuficientes");
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function approve(address _owner, address _spender, uint256 _amount) public returns(bool success){
        allowance[_owner][_spender]=_amount;
        emit  Approval(_owner, _spender, _amount);
        return true;
    }

    function transferFrom (address _from, address _to, uint256 _value) public returns (bool success){
        require(balanceOf[_from]>=_value);
        require (allowance[_from][msg.sender]>=_value);

        balanceOf[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        balanceOf[_to]+=_value;

        emit Transfer(_from, _to, _value);

        return true;

    }
}

